import XCTest
@testable import LumiCore


class KeyGeneratorTests: XCTestCase {
    
    func testExtendedPublicKeys() {
        let generator = KeyGenerator(xpubORxprv: TestExtendedPublicKeyVector.extPublic)
        
        for i in 0..<TestExtendedPublicKeyVector.expectedAddresses.count {
            autoreleasepool(invoking: {
                let k = generator.generateChild(for: UInt(i), hardened: false)

                do {
                    let address = try BitcoinPublicKeyAddress(key: k.key).address
                    
                    XCTAssertTrue(address == TestExtendedPublicKeyVector.expectedAddresses[i], "Wrong address. Expected: \(TestExtendedPublicKeyVector.expectedAddresses[i]) Result: \(address)")
                    
                } catch {
                    XCTAssertNil(error, "\(error)")
                }
            })
        }
    }

    func testVectors() {
        var seed = Data(hex: TestVectors.vector1.seed)
        var generator = KeyGenerator(seed: seed)
        
        for element in TestVectors.vector1.1 {
            autoreleasepool(invoking: {
                try? generator.generate(for: element.path)
                XCTAssertFalse(generator.extPub != element.extpub, "Wrong extended public. Expected: \(element.extpub) Result: \(generator.extPub)")
                XCTAssertFalse(generator.extPrv != element.extprv, "Wrong extended private. Expected: \(element.extprv) Result: \(generator.extPrv)")
                generator.reset()
            })
        }
        
        seed = Data(hex: TestVectors.vector2.seed)
        generator = KeyGenerator(seed: seed)

        for element in TestVectors.vector2.1 {
            autoreleasepool(invoking: {
                try? generator.generate(for: element.path)
                XCTAssertFalse(generator.extPub != element.extpub, "Wrong extended public. Expected: \(element.extpub) Result: \(generator.extPub)")
                XCTAssertFalse(generator.extPrv != element.extprv, "Wrong extended private. Expected: \(element.extprv) Result: \(generator.extPrv)")
                generator.reset()
            })
        }

        seed = Data(hex: TestVectors.vector3.seed)
        generator = KeyGenerator(seed: seed)

        for element in TestVectors.vector3.1 {
            autoreleasepool(invoking: {
                try? generator.generate(for: element.path)
                XCTAssertFalse(generator.extPub != element.extpub, "Wrong extended public. Expected: \(element.extpub) Result: \(generator.extPub)")
                XCTAssertFalse(generator.extPrv != element.extprv, "Wrong extended private. Expected: \(element.extprv) Result: \(generator.extPrv)")
                generator.reset()
            })
        }
    }
    
    func testGenerationVectors() {
        var seed = Data(hex: TestPublicPrivateKeysVector1.seed)
        var generator = KeyGenerator(seed: seed)
        try? generator.generate(for: TestPublicPrivateKeysVector1.externalpath)
        
        for i in 0..<TestPublicPrivateKeysVector1.externalIndexes.count {
            autoreleasepool(invoking: {
                let generated = generator.generateChild(for: UInt(i), hardened: false)
                XCTAssertFalse(generated.serializedPub() != TestPublicPrivateKeysVector1.externalIndexes[i].extpub, "Wrong extended public. Expected: \(TestPublicPrivateKeysVector1.externalIndexes[i].extpub) Result: \(generated.serializedPub())")
                XCTAssertFalse(generated.serializedPrv() != TestPublicPrivateKeysVector1.externalIndexes[i].extprv, "Wrong extended private. Expected: \(TestPublicPrivateKeysVector1.externalIndexes[i].extprv) Result: \(generated.serializedPrv())")
