    func testGenerationSLIP0132() {
        for element in TestExtendedKeySLIP0132Vector.elements {
            let seed = Data(hex: element.seed)
            let generator = KeyGenerator(seed: seed, version: .P2WPKH)
            
            XCTAssertFalse(generator.extPrv != element.root, "Wrong extended private. Expected: \(element.exprv) Result: \(generator.extPrv)")
            
            do {
                try generator.generate(for: "m/84'/0'/0'/0")
                XCTAssertFalse(generator.extPrv != element.exprv, "Wrong extended private. Expected: \(element.exprv) Result: \(generator.extPrv)")
                XCTAssertFalse(generator.extPub != element.expub, "Wrong extended private. Expected: \(element.expub) Result: \(generator.extPub)")
            } catch {
                XCTAssertNotNil(error, "\(error)")
            }
        }
    }
    
    func testDogeGenerationSLIP0132() {
        for element in TestDogeExtendedKeySLIP0132Vector.elements {
            let seed = Data(hex: element.seed)
            let generator = KeyGenerator(seed: seed, version: .DOGE_P2PKH_P2SH)
            
            XCTAssertFalse(generator.extPrv != element.root, "Wrong extended private. Expected: \(element.exprv) Result: \(generator.extPrv)")
            
            do {
                try generator.generate(for: "m/44'/3'/0'/0")
                XCTAssertFalse(generator.extPrv != element.exprv, "Wrong extended private. Expected: \(element.exprv) Result: \(generator.extPrv)")
                XCTAssertFalse(generator.extPub != element.expub, "Wrong extended private. Expected: \(element.expub) Result: \(generator.extPub)")
            } catch {
                XCTAssertNotNil(error, "\(error)")
            }
        }
    }
    
    func testCardanoGenerationShelley() {
        for element in TestCardanoGenerationShelleyVector.vectorCardanoShelley.data {
            autoreleasepool(invoking: {
                let mnemonic = try!  Mnemonic(mnemonic: TestCardanoGenerationShelleyVector.vectorCardanoShelley.mnemonic, pass: "TREZOR", listType: .english)
                
                let generator = CardanoKeyGenerator(entropy: mnemonic.entropy)
                
                do {
                    try generator.generate(for: element.path)

                    XCTAssertTrue(generator.generated.key.data.hex == element.private, "Wrong private. Expected: \(element.private) Result: \(generator.generated.key.data.hex)")
                    
                    XCTAssertTrue(generator.generated.key.publicKey().hex == element.public, "Wrong public. Expected: \(element.public) Result: \(generator.generated.key.publicKey().hex)")

                    XCTAssertTrue(generator.generated.chaincode.hex == element.chaincode, "Wrong chaincode. Expected: \(element.chaincode) Result: \(generator.generated.chaincode.hex)")
                    
                } catch {
                    XCTAssertNotNil(error, "\(error)")
                }
            })
        }
    }
}

